import React, { useEffect, useState } from "react";
import CardService from "../../components/CardService";
import List from "../../components/List";
import { URLSERVER } from "../../Helpers/Constants";
import useNavbar from "../../hooks/useNavbar";

export default function Services({ to }) {
  const [services, setServices] = useState([]);
  const { setUrl } = useNavbar();
  setUrl(to);
  useEffect(() => {
    window.watsonAssistantChatOptions = {
          integrationID: "d6e6ffa1-00f2-4b35-860e-ca6624f746b2", // The ID of this integration.
          region: "us-south", // The region your integration is hosted in.
          serviceInstanceID: "bf1549ca-d360-423b-867f-6c6b6942c5da", // The ID of your service instance.
          onLoad: function(instance) { instance.render(); }
        };
        setTimeout(function(){
          const t=document.createElement('script');
          t.src="https://web-chat.global.assistant.watson.appdomain.cloud/versions/" + (window.watsonAssistantChatOptions.clientVersion || 'latest') + "/WatsonAssistantChatEntry.js";
          document.head.appendChild(t);
        });
})
  useEffect(() => {
    fetch(`${URLSERVER}api/treatments/all-services`, {
      method: "GET",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      mode: "cors",
    })
      .then((res) => res.json())
      .then((data) => {
        setServices(data.data);
      })
      .catch((err) => console.log(err));
  }, []);
  return (
    <List
      title={"Servicios"}
      products={services.map((item, i) => (
        <CardService
          key={i}
          title={item.title}
          image={item.image}
          id={item._id}
        />
      ))}
    />
  );
}
